import React, { Component } from "react";
import Header from "../../component/header";
import MaterialTable from "material-table";
const data = [
  {
    id: 1,
    name: "Kentang"
  },
  {
    id: 2,
    name: "Tomat"
  },
  {
    id: 3,
    name: "Tomat"
  },
  {
    id: 4,
    name: "Tomat"
  },
  {
    id: 5,
    name: "Tomat"
  }
];

class UnitPageList extends Component {
  render() {
    return (
      <div>
        <Header>
          <MaterialTable
            columns={[
              { title: "id", field: "id" },
              { title: "name", field: "name" }
            ]}
            data={data}
            title="Unit"
          />
        </Header>
      </div>
    );
  }
}

export default UnitPageList;
